import React from 'react';
import logo from './logo.svg';
import './App.css';
import {SomeClassComponent, Header} from './SomeClassComponent.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <SomeClassComponent/>
      <Header firstName = "Kevin"/>
      </header>
    </div>
  );
}

export default App;
